  \"Willamette Valley - Oregon White Oak Restoration: North Baskett Butte and Maple
  Knoll RNA\",\n\t\"tracking_summary\": {\n\t\t\"total\": 2,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-07-27T22:57:56.055168\",\n\t\"name\":
  \"willamette-valley-oregon-white-oak-restoration-north-baskett-butte-and-maple-knoll-rna\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This project was the initial work needed
  to preserve the existing oak habitat on WVNWRC by eliminating the Douglas fir overstory.
  North Baskett Butte, on Baskett Slough NWR, has oak woodland that has had serious
  encroachment by Douglas fir trees. Maple Knoll Research Natural Area (RNA), located
  on William L. Finley NWR, also has Douglas fir encroaching and out-competing the
  Oregon white oak habitat. The priority treatment area on Maple Knoll was the oak
  savannah edge that is adjacent to Field 55, a 25 acre prairie restoration site on
  which work began three years prior. Selective cutting of trees using directional
  falling is used to protect residual oaks. On a per treated acre basis, this will
  result in complete eradication of Douglas fir on both sites. Removal of whole trees
  from the site was planned as a separate action (covered by partners and/or with
  other funding sources). When extracted, all larger diameter logs are made available
  for in-stream restoration projects. The remaining smaller logs are utilized for
  wood products through stewardship via Cooperative Agreement. Slash is cleaned up
  mechanically and pile burned. This project will result in the eradication of Douglas-fir
  on approximately 64 acres.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
